  \"Cryogenic Composite Tank Fabrication for Reusable Launch Vehicles Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 12,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:11:31.002057\",\n\t\"name\": \"cryogenic-composite-tank-fabrication-for-reusable-launch-vehicles-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"XCOR has conducted extensive research and
  development, and material characterization analysis of a nonflammable, high-strength,
  lightweight thermoplastic fluoropolymer composite material, trademarked Nonburnite&lt;SUP&gt;TM&lt;/SUP&gt;,
  which is suitable for making reusable, reliable, low cost cryogenic tanks and structures
  for space flight service.  XCOR's composite material is lighter than metal, and
  unlike graphite/epoxy, nonflammable. The material is immune to microcracking, has
  a low coefficient of thermal expansion (CTE), and is capable of withstanding hundreds
  of cryogenic temperature cycles. Additionally, it is durable, repairable, and can
  withstand extreme hot and cold temperatures. The fluoropolymer composite maintains
  strength and flexibility at extreme temperatures (-260 to plus 280 degrees C/-436
  to plus 536 degrees F).Low CTE also allows this composite to be built into a vehicle's
  primary structure. Used as the internal skin in a sandwich structure (Nonburnite,
  foam, and carbon/epoxy) the composite skin-foam-skin material provides both thermal
  insulation and structure. rnThese features, along with the high strength-to-weight
  ratio, make it an enabling technology for building lighter, highly reusable, and
  more robust propellant tanks, thus reducing need for maintenance between flights.
  Further, XCOR believes significant commercialization opportunities exist for the
  material after its manufacturing processes have matured. rnrn\",\n\t\"license_title\":
